import static com.jayway.jsonpath.JsonPath.parse

def response = context.expand( '${Pause Simulation 3#Response}' )

def status = parse(response).read('$.status')
log.info status

if (status == "SOCKET_ERROR") testRunner.gotoStepByName("Pause Simulation 3")

